import React from 'react'
import { MDBCol, MDBContainer, MDBFormInline, MDBIcon, MDBRow } from "mdbreact";

function Searchbar() {
    return (
        <MDBContainer className="mt-5">
            <MDBRow>
                <MDBCol md="11"><input className="form-control form-control w-100" type="text" placeholder="Search" aria-label="Search" /></MDBCol>
                <MDBCol sz="1"><MDBIcon icon="search" className="mt-2"/></MDBCol>
            </MDBRow>
        </MDBContainer>
    )
}

export default Searchbar
